import Header from "../header/header";
import Footer from "../footer/footer";
import Team from "./team/team";
import AboutUs from "./aboutUs/aboutUs";
import Blocks from "./blocks/blocks";
import "./homepage.scss"

function HomepageBuisness () {
    return (
        <div>
            <Header/>


            <div className="ef-hero min-vh-100 d-flex align-content-center align-items-center fadeIn animated"
                 data-anijs="if: scroll, on: window, do: fadeIn animated, before: $scrollReveal">
                <div className="container">
                    <div className="row">
                        <div className="col-lg-12 fadeInUp animated"
                             data-anijs="if: scroll, on: window, do: fadeInUp animated, before: $scrollReveal">
                            <div className="ef-container">
                                <div className="ef-title">
                                    <h1>
                                        Sport Fan or Sport Business, <br/>
                                        it doesn't matter which <br/>
                                        <span>You</span> are the <span>U</span> in STADIU<span>U</span>M
                                    </h1>
                                </div>
                                <div className="ef-content">
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            <Blocks/>
            <AboutUs/>
            <Team/>
            <Footer/>
        </div>
    );
}

export default HomepageBuisness;
